		"id_str": "1507167809750671361",
		"full_text": "다만 정세(팬데믹, 전쟁, 물류대란 등)에 따라 생산과 물류 상황에 변화가 생길 여지가 있어 명확한 발매일은 추후에 고지드릴 수 있을 것 같습니다. 리프레싱반(일반반)의 예약은 다음 기간 동안 진행됩니다.\n\n선주문 기간 : 2022년 3월 25일 오후 2시 ~ 4월 8일 정오 12시",
