		"text": "2. 변경으로 인한 환불기간은 (3월14일 (월) 10시 – 3월 18일 (금) 저녁 5시까지)  입니다. \n \n조금만 기다려 주시면 공연을 더욱 다채롭게 준비하여 4월 1일 만나뵙겠습니다!\n감사합니다.\n\n#프리즘홀 #prismhall #불고기디스코 #티키타카콘서트 #단독공연 #공연연기"
